function HomeWeb() {
    return (
      <div className="min-h-screen flex flex-col">
        <Header />
        <div className="text-5xl w-1/2 text-center mx-auto pt-10 flex-1">
          {/* Your content here */}
          <h1 className="p-2">Hello, welcome to my Blog Page.</h1>
          <h2 className="p-2">I bet y'all gonna find out what I've built</h2>
          <h2 className="p-2">in this blog.</h2>
          <div className="justify-center flex pt-20 text-3xl">
            <button className="border-[3px] px-8 py-4">See more</button>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
